import React from "react";
import "./NavBar.css";
import EmpNameCard from "./EmpNameCard";
const Navbar = () => {
  const navbuttonNames = [
    "Overview",
    "Profile",
    "Calender",
    "Attendance",
    "Documents",
    "Compensation",
    "Support",
  ];
  const navButtons = navbuttonNames.map((nb) => {
    return (
      <div>
        <EmpNameCard />
        <li className="NavButton" href="">
          {nb}
        </li>
      </div>
    );
  });
  return <ul className="NavBar">{navButtons}</ul>;
};

export default Navbar;
